INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796406, 'catalog.text.spec.8', 'люл░Лђл║лхЛѓлИлйл│ЛѓЛќл║ мЏЛІлил╝лхЛѓ л║МЕЛђЛЂлхЛѓЛЃ ЛЂл░л╗л░ЛЂЛІ лХМЎлйлх лЪла Лѓл░л╗л░л┐ лхЛѓЛќл╗лхЛѓЛќлй лХМЎлйлх л║лхл╗лхЛѕлхл║ЛѓЛќ лХм▒л╝ЛІЛЂ.  "лЋмБ м»лил┤Лќл║ лХм▒л╝ЛІЛЂ лЙЛђЛІлй м▒ЛЂЛІлйЛІЛЂЛѓл░ЛђЛІлй мЏл░л╣л┤л░лй лХМЎлйлх мЏл░л╗л░л╣ Лѓл░л▒ЛЃ л║лхЛђлхл║?" л┤лхл│лхлй ЛЂм▒Лђл░мЏ МЎЛђмЏл░Лѕл░лй л║МЕл║лхл╣л┤лх Лѓм▒Лђл░л┤ЛІ. лАЛќлил┤ЛќмБ л▒м▒л╗ ЛЂм▒Лђл░мЊЛІмБЛІлимЊл░ л▒Лќлил┤ЛќмБ МЕлилхл║ЛѓЛќ лилхЛђЛѓЛѓлхЛЃл╗лхЛђЛќл╝Лќли, лХл░мБл░л╗ЛІмЏЛѓл░Лђ лХМЎлйлх Лѓм▒ЛѓЛІлйЛЃЛѕЛІл╗л░Лђл┤ЛІмБ л┐Лќл║ЛќЛђЛќлй Лѓм▒Лђл░мЏЛѓЛІ ЛЂм▒Лђл░л┐ лЙЛѓЛІЛђЛЃЛІл╝ЛІлил┤ЛІмБ л║МЕл╝лхл│Лќ ЛѓлИлхл┤Лќ. лАЛќли лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќл╝лхлй мЏл░л╗л░л╣ ЛѓЛќл╗ Лѓл░л▒ЛІЛЂл░ л▒Лќл╗ЛЃ л║лхЛђлхл║ЛѓЛќл│Лќлй, л║Лќл╝ лХл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ Лѕл░ЛђЛѓЛѓл░ЛђЛІлй м▒ЛЂЛІлйл░ЛѓЛІлйЛІлй, л║Лќл╝лйлхлй л░л╗Лѕл░мЏ л▒лЙл╗ЛЃ л║лхЛђлхл║ЛѓЛќл│Лќлй л▒Лќл╗лхЛѓЛќлй л▒лЙл╗л░ЛЂЛІли. лАЛќлил│лх ЛІмБмЊл░л╣л╗ЛІ л▒лЙл╗ЛЃ м»ЛѕЛќлй л▒Лќли МЎЛђЛќ л╝л░Лђл║лхЛѓлИлйл│ЛѓЛќл║ мЏЛІлил╝лхЛѓ л║МЕЛђЛЂлхЛѓЛЃ  лХМЎлйлх лЪла ЛЂл░л╗л░ЛЂЛІлйЛІмБ ЛѓЛќлиЛќл╝л┤лхл╝лхЛЂЛќлйл┤лх ЛЂл░л┐л░л╗ЛІ,  Лѓлхл║ЛЂлхЛђЛЃл┤лхлй МЕЛѓл║лхлй м▒ЛЂЛІлйЛІЛЂЛѓл░Лђ л▒лхЛђЛќл┐ лЙЛѓЛІЛђл╝ЛІли, ЛЂлЙлйл┤ЛІмЏЛѓл░лй ЛЂЛќлил│лх МЎЛђл▒ЛќЛђ лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќл│лх лХМЎлйлх мЊл░л╗л░л╝ЛѓлЙЛђ ЛѓлЙл╗мЏЛІлйЛІлйл┤л░ лЙЛѓЛІЛђЛІл┐ м▒лил░мЏ ЛЃл░мЏЛІЛѓЛІмБЛІлил┤ЛІ л║лхЛѓЛќЛђЛЃл┤ЛќмБ мЏл░лХлхЛѓЛќ лХлЙмЏ!', 1, 'KZ', false, false);
