INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796193, 'catalog.text.spec.384', 'МелйлхЛђл║МЎЛЂЛќл┐ лХл░л▒л┤ЛІмЏЛѓл░ЛђЛІ ЛЂлхЛђл▓лИЛЂЛќ лХМЕлйЛќлйл┤лхл│Лќ л╝лхлйлхл┤лХлхЛђ лХм▒л╝ЛІЛЂЛІ мЏЛІлиЛІмЏЛѓЛІЛђл░л┤ЛІ л╝л░? лЉЛќЛђл░мЏ лйлхл┤лхлй л▒л░ЛЂЛѓл░ЛђЛІлй л▒Лќл╗л╝лхл╣, л▒л░ЛЂЛІмБЛІли мЏл░ЛѓЛІл┐ лХм»Лђ л╝лх? лЋл│лхЛђ л║МЕлил┤лхл│лхлй л╝л░мЏЛЂл░ЛѓЛІмБЛІли Лѓлхли лХМЎлйлх лЙмБл░л╣ м»л╝ЛќЛѓЛѓЛќ л▓л░л║л░лйЛЂлИЛЈ Лѓл░л▒ЛЃ л▒лЙл╗ЛЂл░, л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІлил▒лхлй л▒м▒л╗ л╝л░мЏЛЂл░ЛѓЛІмБЛІлимЊл░ ЛЂм»ЛђЛќлйл▒лхл╣ лХлхЛѓлхЛЂЛќли! лќл░л╗л┐ЛІ люМЎЛЂл║лхЛЃ л╝лхлй лЙл▒л╗ЛІЛЂЛѓл░Лђл┤ЛІмБ л╝ЛІмБл┤л░мЊл░лй л║лЙл╝л┐л░лйлИЛЈл╗л░ЛђЛІ м▒ЛЂЛІлйЛІл┐ лЙЛѓЛІЛђмЊл░лй лХм▒л╝ЛІЛЂЛѓл░Лђ л║лхли л║лхл╗л│лхлй л┤лхмБл│лхл╣ л╝лхлй лХл░ЛЂЛѓл░мЊЛІ л╝л░л╝л░лйл┤л░Лђл┤ЛІмБ Лѓл░л╗л░л┐-ЛѓЛќл╗лхл║ЛѓлхЛђЛќлй мЏл░лйл░мЊл░ЛѓЛѓл░лйл┤ЛІЛђл░ л░л╗л░л┤ЛІ. лЉЛќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІли л░ЛђмЏЛІл╗ЛІ, л║м»Лѕ-лХЛќл│лхЛђЛќмБЛќли л▒лхлй лХм»л╣л║лхмБЛќлил┤Лќ ЛѓлЙлил┤ЛІЛђл╝л░л╣, лхмБ Лѓл░ЛђЛѓЛІл╝л┤ЛІ л┤л░ л░мЏЛѕл░л╗ЛІ МЕлйлхЛђл║МЎЛЂЛќл┐ лХл░л▒л┤ЛІмЏЛѓл░ЛђЛІ ЛЂлхЛђл▓лИЛЂЛќ лХМЕлйЛќлйл┤лхл│Лќ л╝лхлйлхл┤лХлхЛђ л▓л░л║л░лйЛЂлИЛЈл╗л░ЛђЛІлй Лѓл░л▒л░ л░л╗л░ЛЂЛІли! лќл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ РђЊ лХл░мЏЛЂЛІ МЕл╝ЛќЛђ!', 1, 'KZ', false, false);
