INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5795993, 'catalog.text.spec.18', 'лљл▓ЛѓлЙЛЂл░мЏЛѓл░лйл┤ЛІЛђЛЃ ЛЂл░л╗л░ЛЂЛІлйл░лй лХм▒л╝ЛІЛЂ мЏл░Лђл░ЛЂЛѓЛІЛђЛЃл┤л░ мЏлИЛІлйл┤ЛІмЏЛѓл░Лђ ЛѓЛЃЛІлйл┤л░л┤ЛІ л╝л░? лћлхл╗л┤л░л╗л┤ЛІмЏ лХм»л╣лх лХм»л╣лхл║лхмБЛќлил┤Лќ лХм▒мЏл░ЛђЛѓЛІл┐, лХл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ Лѓл░л▒л░л╝ЛІлй л┤лхл│лхлй л░Лђл╝л░лйЛІмБЛІлил┤ЛІ л║м»л╗-Лѓл░л╗мЏл░лй лхЛѓЛќл┐, л╝м»л╗л┤лх л▒л░ЛЂмЏл░  ЛЂл░л╗л░л╗л░Лђл┤ЛІмБ лХм▒л╝ЛІЛЂЛІлй м▒ЛЂЛІлйЛЃл┤л░ л╝л░? лЉЛќли л▒м▒л╗ л╝МЎЛЂлхл╗лхлйЛќ ЛѕлхЛѕЛќл┐ мЏлЙл╣л┤ЛІмЏ! лЉЛќлил┤ЛќмБ лХм▒л╝ЛІЛЂ ЛѓлЙл▒ЛІл╝ЛІли л░л▓ЛѓлЙЛЂл░мЏЛѓл░лйл┤ЛІЛђЛЃ ЛЂл░л╗л░ЛЂЛІлйл░лй л▒лЙл╗л░Лѕл░мЊЛІ лилЙЛђ лХм▒л╝ЛІЛЂ Лќлил┤лхЛЃ ЛЂЛќлил┤ЛќмБ ЛЂл░лйл░ЛЃл╗ЛІ ЛЂлхл║ЛЃлйЛѓЛѓл░ЛђЛІмБЛІлил┤ЛІ мЊл░лйл░ л░л╗ЛЃ м»ЛѕЛќлй л▒л░ЛђЛІлй ЛЂл░л╗л┤ЛІ! лџл╗л░л▓лИл░ЛѓЛЃЛђл░лйЛІ м▒л╝ЛІЛѓЛІмБЛІли, лхлйл┤Лќ лЙл╗ Лѓлхл║ Лѓм»л╣Лќлйл┤лхл╝лх лХл░лиЛЃмЊл░, лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќмБЛќлил▒лхлй ЛЁл░Лѓ л░л╗ЛІЛЂЛЃмЊл░ мЊл░лйл░ л║лхЛђлхл║ л▒лЙл╗л░л┤ЛІ. лќл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ РђЊ лХлЙл╗ЛІ л▒лЙл╗мЊЛІЛѕЛѓл░ЛђмЊл░ л░Лђлйл░л╗л░л┤ЛІ!', 1, 'KZ', false, false);
INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796336, 'catalog.text.spec.545', 'лџМЕл┐ЛѕЛќл╗Лќл│Лќл╝Лќли м»ЛѕЛќлй мЏЛІлил╝лхЛѓ РђЊ МЕл╝ЛќЛђЛќл╝Лќлил┤ЛќмБ  л▒ЛќЛђ л▒МЕл╗Лѕлхл│Лќ. лќМЎлйлх лхмБ л╝л░мБЛІлил┤ЛІЛЂЛІ лХм▒л╝ЛІЛЂЛІл╝ЛІлил┤ЛІ л╝л░ЛЁл░л▒л▒л░Лѓл┐лхлй л░ЛѓмЏл░ЛђЛЃ РђЊ лЙлйЛІмБ л▒Лќлил│лх мЏЛЃл░лйЛІЛѕ МЎл║лхл╗ЛЃЛќ! лЋл│лхЛђ ЛЂЛќли МЕл╝ЛќЛђЛќмБЛќлил│лх МЕлил│лхЛђЛќЛЂ лхлйл│ЛќмБЛќли л║лхл╗Лќл┐, лйлхл╝лхЛЂлх л░л╗мЊл░ лХЛІл╗лХЛЃ лХл░мЊЛІлй лЙл╣л╗л░л┐, лХлИлйл░мЏЛѓл░ЛЃЛѕЛІ лйлхл╝лхЛЂлх ЛЂл░л╗ЛЃЛѕЛІ-лЙЛђл░ЛЃЛѕЛІ лХм▒л╝ЛІЛЂЛІлй Лќлил┤лхЛЂлхмБЛќли, л▒Лќлил┤ЛќмБ мЏЛІлил╝лхЛѓ л║МЕЛђЛЂлхЛѓЛЃ лХлхл╗Лќл╝Лќли ЛЂЛќлил│лх Лѓлхли л░Лђл░л┤л░ л║МЕл╝лхл║ л▒лхЛђлхл┤Лќ!. лќл░л╣л╗ЛІ м▒лХЛІл╝, лХлЙмЊл░ЛђЛІ лХл░л╗л░мЏЛІ, мЏЛІлиЛІмЏЛѓЛІ лХлЙл▒л░л╗л░Лђ РђЊ лЙЛЂЛІлйЛІмБ л▒л░Лђл╗ЛІмЊЛІлй л▒Лќлил┤ЛќмБ мЏЛІлил╝лхЛѓЛѓлхЛђ ЛѓлЙл┐Лѓл░л╝л░л╝ЛІлил┤л░лй Лѓл░л▒л░ л░л╗л░ЛЂЛІли. лєлил┤лхЛЃ л▒л░ЛђЛІЛЂЛІлйл┤л░ л▒Лќлил┤ЛќмБ лйМЎЛѓлИлХлхл╗Лќ МЎл┤ЛќЛЂЛѓлхЛђЛќл╝Лќлил┤Лќ л┐л░л╣л┤л░л╗л░лйл░ лЙЛѓЛІЛђЛІл┐, ЛЂЛќлил┤ЛќмБ л╝Лќлйл┤лхЛѓЛѓЛќ Лѓм»Лђл┤лх Лѓл░л▒ЛІЛЂЛѓЛІ лХлИлйл░мЏЛѓл░ЛЃЛѕЛІ, ЛЂл░л╗ЛЃЛѕЛІ-лЙЛђл░ЛЃЛѕЛІл╗ЛІмЏ лХм▒л╝ЛІЛЂл┐лхлй мЏл░л╝ЛѓЛІл╗л░ЛѓЛІлйЛІмБЛІлимЊл░ л║лхл┐Лќл╗л┤Лќл║ л▒лхЛђлхл╝Лќли!', 1, 'KZ', false, false);
