INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796239, 'catalog.text.spec.446', 'МўЛђ л░л┤л░л╝ л╝м▒мЏЛѓл░лХЛЂЛІли, лХл░ЛђмЏЛІлй МЕл╝ЛќЛђ, лХлхл║лх м»л╣ л╝лхлй лХл░мЏЛЂЛІ л╝МЎЛѕлИлйлх ЛѓЛЃЛђл░л╗ЛІ л░Лђл╝л░лйл┤л░л╣л┤ЛІ... лЉЛќЛђл░мЏ лХл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ л▒лЙл╗л╝л░л╣ Лѓм▒ЛђЛІл┐, л▒м▒л╗ л░Лђл╝л░лйл┤л░Лђл┤ЛІмБ ЛќЛЂл║лх л░ЛЂЛЃЛІ лхл║ЛќЛѓл░л╗л░л╣ лхл║лхлйЛќлй  л▒л░Лђл╗ЛІмЊЛІ л┤л░ Лѓм»ЛЂЛќлйлхл┤Лќ. лЋл│лхЛђ ЛЂЛќли мЏл░ЛЃЛќл┐ЛЂЛќлил┤Лќл║ лХм»л╣лхл╗лхЛђЛќлй ЛЂл░ЛѓЛЃ ЛЂл░л╗л░ЛЂЛІ ЛѓМЕмБЛќЛђлхл│Лќлйл┤лх лХм▒л╝ЛІЛЂ Лѓл░ЛЃЛІл┐, лЙЛЂЛІлйЛІмБ л▒л░Лђл╗ЛІмЊЛІлйл░ мЏлЙл╗ лХлхЛѓл║ЛќлиЛЃл┤Лќ л║МЕлил┤лхЛЂлхмБЛќли, л▒Лќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗ЛІл╝ЛІли л▒м▒л╗ ЛќЛЂЛѓлх ЛЂЛќлил│лх л║МЕл╝лхл║ЛѓлхЛЂлхл┤Лќ! лЉЛќли ЛЂЛќлил│лх лхл╗Лќл╝Лќлил┤ЛќмБ лХлхЛѓлхл║ЛѕЛќ л║лЙл╝л┐л░лйлИЛЈл╗л░ЛђЛІлйл┤л░мЊЛІ Лѓл░л▒ЛІЛЂмЏл░ лХлхЛѓлхл╗лхл╣ЛѓЛќлй ЛЂл░л┐л░л╗ЛІ л┤л░ л╝л░мБЛІлил┤ЛІ л▓л░л║л░лйЛЂлИЛЈл╗л░Лђл┤ЛІ м▒ЛЂЛІлйЛЃмЊл░ л┤л░л╣ЛІлйл▒ЛІли. лљл╗ л▒Лќлил┤ЛќмБ ЛѓЛќлиЛќл╝л┤лхл╝лхл╝Лќли мЏл░ЛЃЛќл┐ЛЂЛќлил┤Лќл║ лХм»л╣лхл╗лхЛђЛќлй ЛЂл░ЛѓЛЃ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ лхмБ м»л╝ЛќЛѓЛѓЛќ л▓л░л║л░лйЛЂлИЛЈл╗л░ЛђмЊл░ ЛѕЛІмЊЛЃмЊл░ л║МЕл╝лхл║ЛѓлхЛЂлхл┤Лќ.', 1, 'KZ', false, false);
