INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796206, 'catalog.text.spec.4', 'мџЛІлиЛІмЏ Лѓл░ Лѓл░ЛђЛѓЛІл╝л┤ЛІ лХм▒л╝ЛІЛЂ Лќлил┤лхЛЂЛѓЛќЛђЛЃ ЛќЛЂЛќ мЏл░л╣ лХл░мЊЛІлйл░лй л▒л░ЛЂЛѓл░ЛЃ л║лхЛђлхл║ЛѓЛќл│Лќлй л▒Лќл╗л╝лхл│лхлй лХл░лймЊл░, л║МЕл▒ЛќлйлхЛЂлх, л╝л░Лѕл░мЏл░ЛѓЛІ л╝лЙл╗, мЏлИЛІлй л┤л░ м▒лил░мЏ ЛќЛЂл║лх л░л╣лйл░л╗л░л┤ЛІ. лЉЛќЛђл░мЏ л▒Лќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗ЛІл╝ЛІлил┤ЛІ л┐л░л╣л┤л░л╗л░лйл░ лЙЛѓЛІЛђЛІл┐, forex лйл░ЛђЛІмЊЛІлйЛІмБ л▓л░л║л░лйЛЂлИЛЈл╗л░ЛђЛІлй Лѓлхли лХМЎлйлх лйМЎЛѓлИлХлхл╗Лќ Лќлил┤лхЛЂЛѓЛќЛђЛЃ ЛќЛЂЛќлйЛќмБ ЛЂЛІЛђЛІлй л▒Лќл╗Лќл┐ мЏл░лйл░ мЏлЙл╣л╝л░л╣, лЙлйЛІ л▒ЛќЛђл┤лхлй ЛќЛЂл║лх л░ЛЂЛІЛђЛЃмЊл░ л╝м»л╝л║Лќлйл┤Лќл║ ЛѓЛЃл░л┤ЛІ! лЉЛќлил┤лхлй, л║м»Лѕ-лХЛќл│лхЛђЛќ л╝лхлй ЛЃл░мЏЛІЛѓЛІмБЛІлил┤ЛІ л║МЕл┐ л║лхЛѓЛќЛђл╝лхл╣, forex лйл░ЛђЛІмЊЛІлйл┤л░мЊЛІ лхмБ л▒лЙл╗л░Лѕл░мЏЛѓЛІ лХм▒л╝ЛІЛЂЛѓЛІ Лѓл░л▒л░ л░л╗л░ЛЂЛІли. люл░лйЛЂл░л┐ л▒л░ЛЂл┐л░л╗л┤л░мЊЛІлйЛІмБ Лѕлхл│Лќ ЛѓЛЃЛђл░л╗ЛІ м▒л╝ЛІЛѓЛІмБЛІли, л▒Лќлил▒лхлй л▒ЛќЛђл│лх ЛЂЛќли МЎЛђл┤л░л╣ЛІл╝ Лќл╗л│лхЛђЛќ лХЛІл╗лХлИ л░л╗л░ЛЂЛІли!', 1, 'KZ', false, false);
