INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796328, 'catalog.text.spec.536', 'мџЛІлиЛІмЏЛѓЛІ л┤л░ м»л╗л║лхлй ЛЂм▒Лђл░лйЛІЛЂмЏл░ лИлх мЏЛІлил╝лхЛѓЛѓЛќ Лѓл░л▒ЛЃл┤ЛІмБ мЏл░лйЛѕл░л╗ЛІмЏЛѓЛІ ЛЃл░мЏЛІЛѓЛѓЛІл╝ЛІлил┤ЛІ л░л╗л░ЛѓЛІлйЛІлй л▒л░Лђл╗ЛІмЏ л░л┤л░л╝ л▒Лќл╗лхЛѓЛќлй ЛѕЛІмЊл░Лђ. МўЛЂЛќЛђлхЛЂлх МЕлиЛќл╝Лќлил│лх мЏл░ЛѓЛІЛЂЛІ лХлЙмЏ л║МЕл┐Лѓлхл│лхлй л┤лхл╗л┤л░л╗л┤ЛІмЏ лХл░Лђлйл░л╝л░л╗л░Лђ л░Лђл░ЛЂЛІлйл░лй лЙлйЛІ Лѓл░мБл┤л░л┐ л░л╗ЛЃ лЙмБл░л╣ лхл╝лхЛЂ. лАЛќлил┤Лќ л▒м▒л╗ мЏлИЛІлйл┤ЛІмЏЛѓл░лй мЏм▒ЛѓмЏл░ЛђЛІл┐ л░л╗ЛЃ м»ЛѕЛќлй л▒Лќли CRM-лХм»л╣лхЛЂЛќлйл┤лхл│Лќ мЏЛІлил╝лхЛѓл║лхЛђ ЛЂм▒Лђл░лйЛІЛЂЛІлйЛІмБ л▒л░Лђл╗ЛІмЊЛІлй ЛѓлЙл┐Лѓл░ЛЂЛѓЛІЛђЛІл┐ мЏлЙл╣л┤ЛІмЏ. лЉм▒л╗ лХлхЛђл┤лхлй ЛЂЛќли л▒Лќл╗Лќл║ЛѓЛќ л╝л░л╝л░лймЊл░ лиМЎЛђЛЃ л╝ЛІмБл┤л░мЊл░лй л║лЙл╝л┐л░лйлИЛЈл╗л░Лђл┤ЛІ Лѓл░л▒л░ л░л╗л░ЛЂЛІли. лљл╗, лхл│лхЛђ Лѓм»л╣Лќлйл┤лхл╝лхмБЛќлил┤Лќ л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІлимЊл░ лЙЛђлйл░л╗л░ЛЂЛѓЛІЛђЛЂл░мБЛІли, CRM-лХм»л╣лхЛЂЛќ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ лХм▒л╝ЛІЛЂЛѓл░Лђ лЙмБл░л╣ Лѓл░л▒ЛІл╗л░л┤ЛІ! Мели ЛЃл░мЏЛІЛѓЛІмБЛІли л▒лхлй л║м»ЛѕЛќмБЛќлил┤Лќ л▒л░мЊл░л╗л░мБЛІли!', 1, 'KZ', false, false);
