INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796011, 'catalog.text.spec.202', 'лАЛќли мЊлИл╝л░Лђл░ЛѓмЏл░ л║ЛќЛђл│лхлй л║лхлил┤лх л▒ЛќЛђЛќлйЛѕЛќ л║Лќл╝л┤Лќ л║лхлил┤лхЛЂЛѓЛќЛђлхЛЂЛќли? МўЛђлИлйлх, л║м»лилхЛѓЛѕЛќлйЛќ! лџм»лилхЛѓЛѕЛќ РђЊ л║лЙл╝л┐л░лйлИЛЈлйЛІмБ л▒лхЛѓл║лхм▒ЛЂЛѓл░Лђ л░л┤л░л╝ЛІ! Мели ЛќЛЂЛќлйЛќмБ Лѕлхл▒лхЛђЛќ л║лхмБЛЂлхлйЛќ л▒лхЛђЛќл║ мЏл░л╝л░л╗мЊл░ л░л╣лйл░л╗л┤ЛІЛђЛІл┐, лЙлйЛІ ЛЂлхлйЛќл╝л┤Лќ лхл║ЛќлйЛѕЛќ м»л╣ЛќмБЛќли лхЛѓлхл┤Лќ! лЋлйл┤Лќ ЛЂЛќли,м▒л╣ЛІл╝ЛѕЛІл╗ м▒лХЛІл╝, лХлЙмЊл░ЛђЛІ лХл░л╗л░мЏЛІл╗ЛІ, лхмБл▒лхл║л║лх мЏлЙл╗л░л╣л╗ЛІ л║м»лилхЛѓЛѕЛќ л▓л░л║л░лйЛєлИЛЈЛЂЛІлй л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІлил┤л░мЊЛІ ┬Фл║м»лилхЛѓЛѕЛќл╗лхЛђл│лх лХм▒л╝ЛІЛЂ┬╗ л▒МЕл╗Лќл╝Лќлйлхлй л║лхлил┤лхЛЂЛѓЛќЛђлхЛЂЛќли. лЉЛќлил┤ЛќмБ мЏЛІлил╝лхЛѓ л║МЕЛђЛЂлхЛѓЛЃ лХм»л╣лхл╝Лќлил┤Лќ л┐л░л╣л┤л░л╗л░лйл░ лЙЛѓЛІЛђЛІл┐ РђЊ л░л╗ЛѓЛІлй ЛЃл░мЏЛІЛѓЛІмБЛІлил┤ЛІ л▒л░мЊл░л╗л░мБЛІли!', 1, 'KZ', false, false);
