INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796409, 'catalog.text.spec.85', 'лљЛЂЛѓЛІмЏ МЕлйЛќл╝Лќ л╝лхлй МЕлйл┤ЛќЛђЛќЛЂ ЛЂл░л╗л░ЛЂЛІлйЛІмБ лИлйлХлхлйлхЛђЛќ лХм▒л╝ЛІЛЂ лЙЛђлйЛІлй Лѓлхли л░Лђл░л┤л░ Лѓл░л▒ЛЃ л║лхЛђлхл║ л┐лх? лЉЛќлил┤ЛќмБ ЛЂл░л╣ЛѓЛѓЛІ л┐л░л╣л┤л░л╗л░лйЛЂл░мБЛІли, лхЛѕмЏл░лйл┤л░л╣ мЏлИЛІлйл┤ЛІмЏ лХлЙмЏ! лАЛќлил┤ЛќмБ л║м»ЛќмБЛќли л▒лхлй ЛЃл░мЏЛІЛѓЛІмБЛІлил┤ЛІ м»лйлхл╝л┤лхл┐,  Лѕл░ЛђЛѓЛѓл░ЛђЛІ ЛѓлИЛќл╝л┤Лќ лХм▒л╝ЛІЛЂ Лѓл░л▒ЛЃмЊл░ л║МЕл╝лхл║ЛѓлхЛЂлхл╝Лќли. лЉЛќлил┤ЛќмБ мЏЛІлил╝лхЛѓ л║МЕЛђЛЂлхЛѓЛЃЛќл╝Лќли мЏлЙл╗л┤л░лйЛЃмЊл░ ЛІмБмЊл░л╣л╗ЛІ МЎЛђЛќЛЂлЙлйЛѕл░л╗ЛІмЏ лХлхмБЛќл╗, ЛѓЛќл┐ЛѓЛќ ЛЂЛќли мњл░л╗л░л╝ЛѓлЙЛђл┤ЛІ л░л╗мЊл░Лѕ мЏлЙл╗л┤л░лйЛІл┐ лЙЛѓЛІЛђЛЂл░мБЛІли л┤л░, лЙл╗ ЛЂЛќлил│лх лхЛѕмЏл░лйл┤л░л╣ мЏлИЛІлйл┤ЛІмЏ ЛѓЛЃл┤ЛІЛђл╝л░л╣л┤ЛІ! лЉл░Лђ л▒лЙл╗мЊл░лйЛІ л▒ЛќЛђлйлхЛѕлх м»лй мЏл░ЛѓЛЃ, ЛЂЛќли л▒Лќлил┤ЛќмБ м▒ЛЂЛІлйЛІЛЂ ЛѓЛќлиЛќл╝л┤лхл╝лхл╝Лќлил┤лхлй л░ЛЂЛѓЛІмЏ МЕлйл┤ЛќЛђЛЃ лХМЎлйлх МЕлйл┤ЛќЛђЛќЛЂ ЛЂл░л╗л░ЛЂЛІлйЛІмБ лИлйлХлхлйлхЛђЛќ л╝л░л╝л░лйл┤ЛІмЊЛІ л▒лЙл╣ЛІлйЛѕл░ лалхЛЂлхл╣л┤ЛќмБ л░л╗л┤ЛІмБмЊЛІ мЏл░Лѓл░Лђл╗ЛІ л║лЙл╝л┐л░лйлИЛЈл╗л░Лђл┤ЛІмБ л▒ЛќЛђЛќлйлхлй л╝л░мБЛІлил┤ЛІ лХм▒л╝ЛІЛЂ лЙЛђЛІлйЛІлй Лѓл░л▒л░ л░л╗л░ЛЂЛІли. лЮлх л▒лЙл╗л╝л░ЛЂл░ Лѓм»л╣Лќлйл┤лхл╝лх лХл░ЛЂл░л┐, л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІлил┤л░ лХл░ЛђлИЛЈл╗л░мБЛІли.', 1, 'KZ', false, false);
