INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796175, 'catalog.text.spec.367', 'лЋл│лхЛђ ЛЂЛќли л▒л░лйл║ ЛЂл░л╗л░ЛЂЛІлйл┤л░ лХлЙмЊл░ЛђЛІ лХлхЛѓЛќЛЂЛѓЛќл║л║лх лХлхЛѓл║ЛќмБЛќли л║лхл╗ЛЂлх, лЙлйл┤л░ л▒л░лйл║ ЛѓлхЛЁлйлЙл╗лЙл│лИЛЈл╗л░ЛђЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ лХм▒л╝ЛІЛЂЛѓл░Лђ ЛЂЛќлил│лх ЛѓлИЛќл╝л┤Лќ мЏЛІлил╝лхЛѓ л▒лЙл╗л╝л░мЏ! лљл╗ л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛѓл░ ЛЂЛќли МЎЛђмЏл░Лѕл░лй л║лхл╗лхЛѕлхл│Лќ лилЙЛђ, Лѓл░л▒ЛІЛЂЛІ лХлЙмЊл░ЛђЛІ л▓л░л║л░лйЛЂлИЛЈл╗л░ЛђмЊл░ лИлх л▒лЙл╗л░ л░л╗л░ЛЂЛІли. МўЛђлИлйлх, лЙлйл┤л░л╣ лХм▒л╝ЛІЛЂЛѓЛІ Лќлил┤лхЛЃ м»ЛѕЛќлй л║МЕл┐ ЛЃл░мЏЛІЛѓ л║лхЛѓлхл┤Лќ л┤лхЛЃЛќмБЛќли л╝м»л╝л║Лќлй. лЉЛќЛђл░мЏ л▒Лќлил┤ЛќмБ ЛЂлхЛђл▓лИЛЂЛѓЛќ л┐л░л╣л┤л░л╗л░лйл░ лЙЛѓЛІЛђЛІл┐, лЙлйл┤л░л╣ мЏлИЛІлйл┤ЛІмЏмЏл░ л║лхлил┤лхЛЂл┐лхл╣ЛЂЛќли. лЉЛќлил┤ЛќмБ л║л░Лѓл░л╗лЙл│ ЛЂл░лйл░ЛЃл╗ЛІ ЛЂлхл║ЛЃлйл┤ ЛќЛѕЛќлйл┤лх л▒л░лйл║ ЛѓлхЛЁлйлЙл╗лЙл│лИЛЈЛЂЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ л▒л░Лђл╗ЛІмЏ л▓л░л║л░лйЛЂлИЛЈл╗л░Лђл┤ЛІ м▒ЛЂЛІлйл░ л░л╗л░л┤ЛІ. лЉЛќлил┤ЛќмБ лилхЛђЛѓЛѓлхЛЃЛќл╝Лќли лхмБл▒лхл║ лйл░ЛђЛІмЊЛІ л║ЛЃЛђЛЂЛІлйл┤л░мЊЛІ лХл░мБл░ л▓л░л║л░лйЛЂлИЛЈл╗л░Лђл┤ЛІ ЛѓлИЛќл╝л┤Лќ Лѓл░Лђл░ЛѓЛЃ, л░л╗ л╝л░л╝л░лйл┤л░Лђ МЎЛђл┤л░л╣ЛІл╝ л┤м▒ЛђЛІЛЂ Лѓм»л╣Лќлйл┤лхл╝лх ЛѓлЙл╗ЛѓЛІЛђЛЃмЊл░ л║МЕл╝лхл║ л║МЕЛђЛЂлхЛѓлхл┤Лќ.', 1, 'KZ', false, false);
