INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796338, 'catalog.text.spec.547', 'лЉлЙл╗л░Лѕл░мЊЛІ лилЙЛђ м▒ЛЂЛѓл░ мЏЛІлил╝лхЛѓЛќлй Лќлил┤лхл┐ лХм»ЛђЛЂЛќли л▒лх? лєлил┤лхл│лхлйл│лх ЛЂм▒Лђл░мЊл░лй! лЉЛќлил┤ЛќмБ мЏЛІлил╝лхЛѓ лХм»л╣лхл╝Лќлил┤Лќ л┐л░л╣л┤л░л╗л░лйл░ лЙЛѓЛІЛђЛІл┐, л▒ЛќЛђлйлхЛѕлх ЛѓлхЛѓЛќл║ЛѓЛќ л▒л░ЛЂЛЃ л░ЛђмЏЛІл╗ЛІ, МЕлиЛќмБЛќлил│лх л║лхЛђлхл║ЛѓЛќ лХм▒л╝ЛІЛЂмЏл░ м»лй мЏл░Лѓл░ л░л╗л░ЛЂЛІли. лбм»л╣Лќлйл┤лхл╝лхмБЛќлил┤Лќ л▒Лќлил┤ЛќмБ ЛЂл░л╣ЛѓЛІл╝ЛІлимЊл░ л╗л░мЏЛѓЛІЛђЛІмБЛІли, МЕлиЛќмБЛќлил│лх л║МЎЛЂЛќл▒лИ л╝л░л╝л░лй ЛђлхЛѓЛќлйл┤лх ЛЂЛќл╗Лѓлхл╝лх лХл░ЛЂл░мБЛІли! лЉм▒л╗ МЎЛђлхл║лхЛѓЛќмБЛќлил┤ЛќмБ  ЛЂл░л┐л░л╗ЛІ лХм▒л╝ЛІЛЂ  Лѓл░л▒ЛЃмЊл░ МЕли ЛЂлхл┐ЛѓЛќл│Лќлй ЛѓлИл│ЛќлилхЛђЛќ ЛЂМЕлиЛЂЛќли, ЛѓЛќл┐ЛѓЛќ м▒ЛЂЛѓл░л╗ЛІмЏ мЏЛІлил╝лхЛѓ ЛЂЛќлил┤Лќ МЕлиЛќ Лќлил┤лхл┐ л║лхл╗ЛЂлх, Лѓл░мБмЊл░л╗л╝л░мБЛІли!', 1, 'KZ', false, false);
