INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796177, 'catalog.text.spec.369', 'лЋЛЂлхл┐ЛѓлхЛЃ ЛЂл░л╗л░ЛЂЛІлйл┤л░ мЏЛІлил╝лхЛѓ лхЛѓл║ЛќмБЛќли л║лхл╗лх л╝лх, л▒ЛќЛђл░мЏ лЙлйл┤л░л╣ мЏЛІлил╝лхЛѓЛѓЛќ ЛѓлИЛќл╝л┤Лќ МЎЛђЛќ Лѓлхли Лѓл░л▒ЛЃл┤ЛІмБ лХлЙл╗ЛІлй л▒Лќл╗л╝лхл╣ЛЂЛќли л▒лх? лЉЛќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗  ЛЂЛќлил▒лхлй л▓л░л║л░лйЛЂлИЛЈлйЛІ ЛѓМЎлиЛќ МЎЛђЛќ ЛЂМЎЛѓЛѓЛќ Лѓл░л▒ЛЃл┤ЛІмБ мЏм▒л┐лИЛЈл╗л░ЛђЛІлй л▒МЕл╗ЛќЛЂЛЃл│лх МЎЛђл┤л░л╣ЛІл╝ л┤л░л╣ЛІлй! лЉЛќлил┤ЛќмБ ЛЂл░л╣ЛѓЛѓл░лй лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќлйЛќмБ лйл░лил░ЛђЛІлй л░ЛЃл┤л░Лђл░ЛѓЛІлй, л║МЕл┐ЛѕЛќл╗Лќл║ЛѓЛќмБ ЛќЛѕЛќлйлхлй ЛЂЛќлил┤Лќ лХм▒л╝ЛІЛЂмЏл░ мЏл░л▒ЛІл╗л┤л░ЛЃЛІлйл░ ЛІмЏл┐л░л╗ лхЛѓлхЛѓЛќлй ЛЂл░ЛЃл░ЛѓЛѓЛІ Лѓм»л╣Лќлйл┤лхл╝лхлйЛќ л┤м▒ЛђЛІЛЂ ЛѓлЙл╗ЛѓЛІЛђЛЃл┤ЛІмБ лХм»л╣лхЛЂЛќлй л▒Лќл╗лх л░л╗л░ЛЂЛІли. лАЛќл╗Лѓлхл╝лхл╗лхЛђл│лх ЛѓЛќЛђл║лхл╗ЛЃ л░ЛђмЏЛІл╗ЛІ ЛЂЛќли лхмБл▒лхл║ лйл░ЛђЛІмЊЛІлйл┤л░мЊЛІ лхмБ ЛЂлЙмБмЊЛІ лХл░мБл░л╗ЛІмЏЛѓл░Лђл┤л░лй ЛЁл░л▒л░Лђл┤л░Лђ л▒лЙл╗л░ЛЂЛІли, мЏл░л╣л┤л░ л▒л░ЛђЛІл┐ лХм▒л╝ЛІЛЂ ЛќЛЂЛѓлхл│лхлй ЛѓлИЛќл╝л┤Лќ лхл║лхлйЛќлй л░л╗л┤ЛІлй л░л╗л░ л▒Лќл╗Лќл┐ лЙЛѓЛІЛђл░ЛЂЛІли. лљл╗ л▒Лќлил┤ЛќмБ л║л░Лѓл░л╗лЙл│ЛѓЛІ мЏлЙл╗л┤л░лйл░ лЙЛѓЛІЛђЛІл┐, мЏл░л╗л░л╝ЛІлил┤л░мЊЛІ лхЛЂлхл┐ЛѓлхЛЃ ЛЂл░л╗л░ЛЂЛІлйЛІмБ л┐лхЛђЛЂл┐лхл║ЛѓлИл║л░л╗ЛІмЏ л▓л░л║л░лйЛЂлИЛЈл╗л░ЛђЛІл╝лхлй мЏл░ЛЂ мЏл░мЊЛІл╝ ЛЂМЎЛѓЛѓлх-л░мЏ л║МЕЛђЛќл┐ Лѓл░лйЛІЛЂл░ л░л╗л░ЛЂЛІли.', 1, 'KZ', false, false);
