INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796072, 'catalog.text.spec.263', 'МўЛђл▒ЛќЛђ л░л┤л░л╝ л║лхл┤лхл╣л╗Лќл║ЛЂЛќли, лХл░ЛђмЏЛІлй МЕл╝ЛќЛђ ЛЂм»ЛђЛЃл┤Лќ л░Лђл╝л░лйл┤л░л╣л┤ЛІ, лХлхл║лх м»л╣Лќ, лХл░мЏЛЂЛІ л╝л░ЛѕлИлйл░ЛЂЛІ л▒лЙл╗мЊл░лйЛІлй мЏл░л╗л░л╣л┤ЛІ. лЉЛќЛђл░мЏ лХл░мЏЛЂЛІ лХм▒л╝ЛІЛЂ л▒лЙл╗л╝л░л╣ЛІлйЛѕл░ л▒м▒л╗ л░Лђл╝л░лйл┤ЛІ лХм»лилхл│лх л░ЛЂЛІЛђЛЃ л╝м»л╝л║Лќлй лхл╝лхЛЂ лхл║лхлйЛќлй л▒л░Лђл╗ЛІмЊЛІ л▒Лќл╗лхл┤Лќ. лЋл│лхЛђ ЛЂЛќли л║МЎЛЂЛќл┐лЙЛђЛІлй л▒л░ЛЂЛѕЛІл╗ЛІмЊЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ мЏЛІлил╝лхЛѓЛѓЛќ Лѓл░л▒л░ лЙЛѓЛІЛђЛІл┐, лЙЛЂЛІ л╝л░мЏЛЂл░ЛѓЛѓл░ЛђмЊл░ лХлхЛѓЛЃл┤Лќ л║МЕлил┤лхл│лхлй л▒лЙл╗ЛЂлхмБЛќли, л▒Лќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗ л║МЕл╝лхл║л║лх л║лхл╗лхл┤Лќ! лЉЛќли МЎЛђмЏл░Лѕл░лй ЛЂЛќлил│лх лхл╗л┤лхл│Лќ лХлхЛѓлхл║ЛѕЛќ л║лЙл╝л┐л░лйлИЛЈл╗л░Лђл┤л░ л▒лЙл╗л░ЛѓЛІлй ЛЂл░л┐л░л╗ЛІ МЎЛђЛќ л╝л░мБЛІлил┤ЛІ  л▒лЙЛЂ лЙЛђЛІлйл┤ЛІ м▒ЛЂЛІлйЛЃмЊл░ л┤л░л╣ЛІлйл▒ЛІли. лЉЛќли м▒ЛЂЛІлймЊл░лй лХм▒л╝ЛІЛЂ л░ЛђмЏЛІл╗ЛІ ЛЂЛќли МЕли л╝л░мЏЛЂл░ЛѓЛІмБЛІлимЊл░ лХлхЛѓлх л░л╗л░ЛЂЛІли.    лЉЛќлил┤ЛќмБ л║л░Лѓл░л╗лЙл│ л▒ЛќЛђ-лхл║Лќ м»лй мЏл░ЛѓмЏл░лйлйл░лй л║лхл╣Лќлй-л░мЏ л║МЎЛЂЛќл┐лЙЛђЛІлй л▒л░ЛЂЛѕЛІл╗ЛІмЊЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░ЛІ лХм▒ЛІЛЂЛѓл░ЛђмЊл░ мЏлЙл╗ лХлхЛѓл║ЛќлиЛЃл│лх л╝м»л╝л║Лќлйл┤Лќл║ л▒лхЛђлхл┤Лќ.', 1, 'KZ', false, false);
