INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796398, 'catalog.text.spec.72', 'лЌл░мБ ЛѕЛІмЊл░ЛђЛЃЛѕЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░ лХм▒л╝ЛІЛЂ ЛќЛЂЛѓлхЛЃ лйлИлхЛѓЛќмБЛќли л▒л░Лђ л╝л░, л▒ЛќЛђл░мЏ лЙлйЛІ мЏл░л╗л░л╣ Лѓлхли л░Лђл░л┤л░ Лѓл░л▒ЛЃ л║лхЛђлхл║ лхл║лхлйЛќлй л▒Лќл╗л╝лхл╣ЛЂЛќли л▒лх? лЉЛќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗ МЎЛђмЏл░Лѕл░лй Лѓлхли лХМЎлйлх лйМЎЛѓлИлХлхл╗Лќ лХм▒л╝ЛІЛЂ Лѓл░л▒ЛЃл┤ЛІмБ мЏм▒л┐лИЛЈл╗л░ЛђЛІл╝лхлй ЛЂЛќлил▒лхлй л▒МЕл╗ЛќЛЂЛЃл│лх МЎлиЛќЛђ. лЉЛќлил┤ЛќмБ л┐лЙЛђЛѓл░л╗л┤л░лй Лѓм»л╣Лќлйл┤лхл╝лхлйЛќ мЏл░л╗л░л╣ л┤м▒ЛђЛІЛЂ мЏм▒Лђл░л┐, лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќ мЏл░л╗л░л╣ ЛЂЛќлил┤Лќ мЊл░лйл░ Лѓл░мБл┤л░л╣ЛѓЛІлйл┤л░л╣ лхЛѓЛЃл┤ЛќмБ лХлЙл╗л┤л░ЛђЛІлй л║МЕЛђЛЂлхЛѓлхл┤Лќ. лбм»л╣Лќлйл┤лхл╝лх Лѓл░Лђл░ЛѓЛЃмЊл░ лХл░лиЛІл╗ЛІл┐, лхмБл▒лхл║ лйл░ЛђЛІмЊЛІлйл┤л░мЊЛІ лХл░мБл░л╗ЛІмЏЛѓл░Лђ ЛѓЛЃЛђл░л╗ЛІ ЛЁл░л▒л░Лђ л░л╗ЛІл┐, лЙл╗л░Лђл┤ЛІ л▒Лќл╗Лќл┐, мЏл░л╣л┤л░ лХм▒л╝ЛІЛЂ ЛќЛЂЛѓлхЛЃ ЛѓлИЛќл╝л┤Лќ лхл║лхлйЛќлй л▒Лќл╗Лќл┐ лЙЛѓЛІЛђл░ЛЂЛІли. лљл╗ л▒Лќлил┤ЛќмБ м▒ЛЂЛІлйЛІЛЂ ЛѓЛќлиЛќл╝л┤лхл╝лхл╝Лќлил┤Лќ мЏлЙл╗л┤л░лйЛІл┐, ЛЂЛќлил┤ЛќмБ мЏл░л╗л░мБЛІлил┤л░мЊЛІ лил░мБ ЛѕЛІмЊл░ЛђЛЃЛѕЛІл╗ЛІмЏ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ л║лхл╗лхЛѕлхл║ЛѓЛќ лХм▒л╝ЛІЛЂЛѓл░Лђл┤ЛІ лХЛІл╗л┤л░л╝ л║МЕЛђлх л░л╗л░ЛЂЛІли!', 1, 'KZ', false, false);
