INSERT INTO translation (translation_id, name, value, site_id, lang, dirty, ui) VALUES (5796074, 'catalog.text.spec.265', 'лАЛќлил│лх лХм▒л╝ЛІЛЂ Лѓл░л▒ЛЃмЊл░ лхЛѕмЏл░лйл┤л░л╣ л║МЕл╝лхл│Лќ лХлЙмЏ Лќлил┤лхЛЃ лХм»л╣лхЛЂЛќл╝лхлй л║м»ЛђлхЛЂЛЃл┤лхлй лХл░л╗ЛІмЏЛѓЛІмБЛІли л▒л░? ┬ФлљЛЃЛІл╗Лѕл░ЛђЛЃл░ЛѕЛІл╗ЛІмЊЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ лХм▒л╝ЛІЛЂмЏл░┬╗ ЛЂм▒Лђл░лйЛІЛЂ лХл░ЛЂл░ЛЂл░мБЛІли л▒л░ЛЂмЏл░ л▓л░л║л░лйЛЂлИЛЈл╗л░Лђ лйлхл╝лхЛЂлх л▒л░ЛЂмЏл░ мЏл░л╗л░л╗л░Лђл┤л░мЊЛІ мЏЛІлил╝лхЛѓЛѓлхЛђ м▒ЛЂЛІлйЛІл╗л░ л╝л░? лълйл┤л░ л▒Лќлил┤ЛќмБ л║л░Лѓл░л╗лЙл│Лѓл░мЊЛІ м▒ЛЂЛІлйЛІЛЂЛѓл░Лђл┤ЛІ л┐л░л╣л┤л░л╗л░лйЛІмБЛІли! лбЛќлйЛѓЛЃЛќЛђл│лх л▒ЛќЛђ-лхл║Лќ ЛѕлхЛђЛѓЛЃ л░ЛђмЏЛІл╗ЛІ ЛЂЛќли МЎл┐-ЛЂМЎЛѓЛѓлх л░ЛЃЛІл╗Лѕл░ЛђЛЃл░ЛѕЛІл╗ЛІмЊЛІ ЛЂл░л╗л░ЛЂЛІлйл┤л░мЊЛІ л╝ЛІмБл┤л░мЊл░лй м▒ЛЂЛІлйЛІЛЂЛѓл░Лђл┤ЛІмБ ЛќЛѕЛќлйлхлй мЏЛІлиЛІмЏЛѓЛІ МЎЛђЛќ лХл░ЛђмЏЛІлй лХм▒л╝ЛІЛЂ л▓л░л║л░лйЛЂлИЛЈЛЂЛІлйл░ лИлх л▒лЙл╗л░ЛЂЛІли. мџлЙл╗л░л╣л╗ЛІ лИлйЛѓлхЛђЛёлхл╣ЛЂ м▒лйл░мЊл░лй м▒ЛЂЛІлйЛІЛЂЛѓл░Лђл┤ЛІ л╗лхлил┤лх Лѓл░ЛЃЛІл┐ л▒лхЛђЛЃл│лх л╝м»л╝л║Лќлйл┤Лќл║ лХл░ЛЂл░л╣л┤ЛІ лХМЎлйлх лХм▒л╝ЛІЛЂ л▒лхЛђЛЃЛѕЛќлйЛќмБ ЛѕлхЛѕЛќл╝Лќлйлх л┤лхл╣Лќлй л▒л░мЏЛІл╗л░л┐ лЙЛѓЛІЛђл░л┤ЛІ. лЋмБ лХл░ЛђмЏЛІлй лХм▒л╝ЛІЛЂ - Лѓлхл║ л▒Лќлил┤лх мЊл░лйл░!', 1, 'KZ', false, false);
